import React from 'react';
import Carousel from 'react-bootstrap/Carousel';
import Navebar from './Navebar'; // If you want to use this, add <Navebar /> below

// Placeholder component for carousel images
function ExampleCarouselImage({ text }) {
    return (
        <div
            style={{
                width: '100%',
                height: '400px',
                backgroundColor: '#eee',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                fontSize: '2rem',
            }}
        >
            {text}
        </div>
    );
}

function About() {
    return (
        <>
            {/* Uncomment if you want to show the navbar */}
            {/* <Navebar /> */}
            <Carousel fade>
                <Carousel.Item>
                    <ExampleCarouselImage text="First slide" />
                    <Carousel.Caption>
                        <h3>First slide label</h3>
                        <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
                    </Carousel.Caption>
                </Carousel.Item>
                <Carousel.Item>
                    <ExampleCarouselImage text="Second slide" />
                    <Carousel.Caption>
                        <h3>Second slide label</h3>
                        <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
                    </Carousel.Caption>
                </Carousel.Item>
                <Carousel.Item>
                    <ExampleCarouselImage text="Third slide" />
                    <Carousel.Caption>
                        <h3>Third slide label</h3>
                        <p>
                            Praesent commodo cursus magna, vel scelerisque nisl consectetur.
                        </p>
                    </Carousel.Caption>
                </Carousel.Item>
            </Carousel>
            <div className="container mt-5">
                <h1 className="text-primary">React + Bootstrap Example</h1>
                <button className="btn btn-success">Click Me</button>
            </div>
            <div className="container mt-5">
                <h2>About Us</h2>
                <p>
                    We are a team of passionate developers dedicated to creating amazing web applications.
                </p>
            </div>
        </>
    );
}

export default About;
